import React from 'react';
import{useState,useEffect} from "react"
import SecondPage from './SecondPage';
i

function SecondFrontPage() {

const [data,setData]=useState([])
function click(){
fetch("https://www.themealdb.com/api/json/v1/1/search.php?s")
.then((response)=>response.json())
.then((datas)=>{
  const food=[{
  Instructions:datas.meals[0].strInstructions,
  image:datas.meals[0].strMealThumb,
  links:datas.meals[0].strYoutube,
  mealname:datas.meals[0].strMeal,
  id:1
  }, 
 { Instructions:datas.meals[1].strInstructions,
   image:datas.meals[1].strMealThumb,
   links:datas.meals[1].strYoutube,
   mealname:datas.meals[1].strMeal,
   id:2
}]
setData(food) 
 })
.catch((e)=>{
    console.log(e);
})}
const FrontData=data.map(datas=>{
  return(
  <div key={datas.id} >
   <SecondPage  Instructions={datas.Instructions}  name={datas.mealname} image={datas.image} videolinks={datas.links} />
  </div>)
}) 
useEffect(()=>{
const isstop=false;
if(!isstop){
click()}
return(()=>{
isstop=true
})
},[])

return(
<div  >
      {FrontData}
</div>)
}

export default SecondFrontPage;
